import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import imageFile from "./Images/vvv.png";
import Image from "react-bootstrap/Image";
import Row from 'react-bootstrap/esm/Row';
import Col from 'react-bootstrap/esm/Col';

const ContentColumn = () => {
  return (
    <Row className="container-fluid mt-5">
      <Col xs={12} md={4} lg={3}>
        At ELITE we strongly believe in Patnering with you for a safer, cleaner
        and better environment by helping you keep tack of your schedule dates
        and also teach you more about segregation of waste and recycling of
        waste....... read more
      </Col>

      <Col xs={12} md={4} lg={3}>
        <Card style={{ width: "18rem" }}>
          <Card.Img variant="top" src={imageFile} />
        </Card>
      </Col>
    </Row>
  );
};

export default ContentColumn;
